Is there any way to change the background color of an adaptive card in Microsoft teams?

## Answer (1)

You can use the `style` property of the `Container` to change the background color of an adaptive card in Microsoft teams.

Here is an example:

```
{
    "type": "AdaptiveCard",
    "version": "1.0",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a test card",
                    "wrap": true
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            },
            "style": "emphasis",
            "bleed": true,
            "separator": true,
            "spacing": "none",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a test card",
                    "wrap": true
                }
            ]
        }
    ]
}
```

You can use the following values for the `style` property:

- `emphasis`: The container has a dark background color.
- `good`: The container has a green background color.
- `attention`: The container has a yellow background color.
- `warning`: The container has a red background color.
- `positive`: The container has a light green background color.
- `default`: The container has a white background color.

## Tooltip

```jsx
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      openTooltip(id);
    }
  };

  const handleMouseLeave = () => {
    if (activeTooltip === id) {
      closeTooltip();
    }
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      className={`relative ${activeTooltip === id ? 'z-10' : '-z-10'}`}
    >
      {children}
      {activeTooltip === id && (
        <div className="absolute top-full left-1/2 transform -translate-x-1/2 bg-white border border-gray-300 py-1 px-2 rounded shadow-lg">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

## Usage

```jsx
import TooltipProvider from '../components/Tooltip';
import Tooltip from '../components/Tooltip';

